  false,\n\t\"url\": null,\n\t\"notes\": \"Update on research implemented by Nebraska
  Game and Parks Commission and the U.S. Fish and Wildlife Service on the management
  of elk on Fort Niobrara National Wildlife Refuge. The purpose of this study was
  to fill information gaps to enable the U.S. Fish and Wildlife Service (USF&WS) and
  Nebraska Game and Parks Commission to better predict and assess progress towards
  managing for a sustainable, free-roaming elk population on and in the vicinity of
  Fort Niobrara NWR for viewing and hunting opportunities, as well as managing elk
  populations within the Niobrara River valley.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
